import React, { Component } from "react";

class Seats extends Component {
  render() {
    const subRows = [];
    for (let i = 0; i < this.props.subRows; i++) {
      subRows.push(<Seats placeNumber={i} />);
    }

    return <div className="row" />;
  }
}

export default Rows;
